import React, { PropsWithChildren } from 'react';
import TodoElement from './TodoElement';
import { StyledDesktopContainer } from './todoDesktop.styled';

type Props = PropsWithChildren<{
  todos: any;
}>;

export default function TodoContainer({ todos }: Props) {
  return (
    <StyledDesktopContainer>
      <thead>
        <tr>
          <th>Todo Title</th>
          <th>Description</th>
          <th>Actions</th>
        </tr>
      </thead>
      <tbody>
        {todos.map((todo: any) => (
          <TodoElement key={todo.id} todo={todo} />
        ))}
      </tbody>
    </StyledDesktopContainer>
  );
}
